import React from "react";
import "react-quill/dist/quill.snow.css";
import ReactQuill from "react-quill";
import { Card, CardBody, Form, FormInput, Button, Slider } from "shards-react";
import AdminDashboard from ".";
import "./CSS/addBlog.css";
import "./CSS/addJob.css";

import AdminFooter from "./admin-footer";

function AddJob() {
  return (
    <div>
      <AdminDashboard />
      <div>.</div>
      <Card small className="addForm">
      <div className="form-title">POST A NEW JOB</div>

        <CardBody>
          <Form className="add-new-post">
            <FormInput
              size="lg"
              className="mb-3 job-col1"
              placeholder="Job Title"
            />


<Slider connect={[true, false]} start={[20]} range={{ min: 0, max: 100 }} />

            {/* <div>Validity</div> */}
            {/* <FormInput
              size="lg"
              className="mb-3 job-col1 job" 
              placeholder="Validity" type="date"
            /> */}
             {/* <Slider className="mb-3 job-col1 job" connect={[true, false]} start={[20]} range={{ min: 0, max: 100 }} /> */}
            <ReactQuill className="add-new-post__editor mb-1" placeholder="Description of the Job here" />
          </Form>
        </CardBody>
        <div className="publish"><button className="publish-btn">Publish</button></div>

      </Card>

      {/* <div style={{textAlign:"center"}}>Test</div> */}
      <AdminFooter/>
    </div>
  );
}

export default AddJob;
